import { StyleSheet, Text, View } from 'react-native';
import AsyncStorage from '@react-native-async-storage/async-storage';
import { useEffect } from 'react';
import axios from 'axios';
import Star from './components/Star'
import { count } from '../helpers/count';

export default function Deposit() {

	const getCounts = async () => {
		const token = await AsyncStorage.getItem('token')
		const response = await axios({
			method: 'post',
			url: 'http://localhost:3006/api/v1/todos',
			data: {
				token
			}
		});
		console.log(response.data);
	}

	useEffect(() => {
		getCounts()
	}, [])

	const amounts = [
		{
			money: 60006.66,
			number: '1000019705',
			currensy: 'RUB'
		},
		{
			money: 57057.22,
			number: '1000019705',
			currensy: 'USD'
		},
		{
			money: 4398.66,
			number: '1000019705',
			currensy: 'EUR'
		},
		{
			money: 60006.66,
			number: '1000019705',
			currensy: 'RUB'
		},
		{
			money: 60006.66,
			number: '1000019705',
			currensy: 'EUR'
		},
	]

	return (
		<View style={styles.container}>
			<Text style={styles.heading}>Торговые счета</Text>
			<View style={styles.block}>
				<Star width={20} height={20}/>
				<View style={styles.miniblock}>
					<Text style={styles.uptext}>{count(amounts[0].money)}</Text>
					<Text style={styles.subtext}>{amounts[0].number} - С хеджированием</Text>
				</View>
			</View>
			<View style={styles.block}>
				<Text style={styles.text}>Торговые счета</Text>
			</View>
			<View style={styles.block}>
				<Text style={styles.text}>Торговые счета</Text>
			</View>
			<View style={styles.block}>
				<Text style={styles.text}>Торговые счета</Text>
			</View>
		</View>
	);
}

const styles = StyleSheet.create({
	container: {
		paddingTop: '13%',
		backgroundColor: 'rgb(22, 50, 89)',
		height: '100%',
	},
	block: {
		flex: 1,
		flexDirection: 'row',
		justifyContent: 'start',
		alignItems: 'center',
		gap: '10px',
		backgroundColor: 'white',
		marginLeft: '20px',
		marginRight: '20px',
		paddingLeft: '20px',
		paddingRight: '20px',
		// paddingTop: '-50px',
		// paddingBottom: '-50px',
		borderRadius: 4,
		height: '30px'
	},
	heading: {
		fontSize: 30,
		textAlign: 'center',
		fontWeight: '700',
		marginBottom: '10%',
		color: 'white',
	},
	text: {
		color: 'black',
	}
})
